{
    var result,name,city,state,country,zip,bd,gender
    useEffect(()=>{
        getup(sessionStorage["useremail"])
    })

    async function getup(email)
    {
        //console.log("IN HERE")
        result=await getUserprofile(email)
        name=result[0]+" "+result[1]
        console.log(name)
    }

    return(
        <div>
            <h2>Profile</h2>
            <div>
                <h4>Name:{name}</h4>
            </div>
        </div>
    )
}
